import React from 'react'
import { useRecoilState } from 'recoil'

export default function Dashboard() {
    const [admin , setAdmin] = useRecoilState(myState)
    return (
        <div>
            this is dashboard page
            {
                admin.map(ad => 
                <ul>
                    <li>ID : {ad.id}</li>
                    <li>Username : {ad.username}</li>
                    <li>Position : {ad.position}</li>
                </ul>
            )
            }
            
        </div>
    )
}
